import fire from "../../fire";
import IsLoggedInUser from "../../store/store";
import { useContext } from "react";
import "./header.css";
import { Navbar, Nav, Form } from "react-bootstrap";
import { Link } from "react-router-dom";

function Header(props) {
  const handleLogout = () => {
    fire.auth().signOut();
  };

  const [isLoggedIn, setIsLoggedIn] = useContext(IsLoggedInUser);
  return (
    <>

      <Navbar
        bg="dark"
        variant="dark"
        style={{
          marginBottom: "-40px",
        }}
      >
        <Link className="homeBtn" to="/">
          SW
        </Link>

        <Nav className="mr-auto">
          <Nav.Link href="/homePage/HomePage">Home</Nav.Link>
          <Nav.Link href="/about/About">About</Nav.Link>
          <Nav.Link to="#pricing">FAQ</Nav.Link>
          <Nav.Link to="#"> | </Nav.Link>
          {setIsLoggedIn ? (<Nav.Link onClick={handleLogout}>Login</Nav.Link>) : (<Nav.Link onClick={handleLogout}>Logout</Nav.Link>)}
          {/* <Nav.Link onClick={handleLogout}>Logout</Nav.Link> */}

        </Nav>
        {setIsLoggedIn ? (<Form inline>
          <p className="welcome">Welcomeasd {props.userName} </p>
        </Form>) : (<Form inline>
          <p className="welcome">Please sign in {props.userName} </p>
        </Form>)}

      </Navbar>
      <br />
    </>
  );
}

export default Header;
